# Auto-generated EV sparse table (only non-zeros).
# MAX_N = 1000
from decimal import Decimal

# EV[p][q]에서 p가 0부터 994까지의 데이터는 삭제했습니다.
# 실제 22222.py에서 dump_EV_log_style를 잘 수정하면 됩니다.
EV_SPARSE = {
    995: {995: Decimal("9.-10")},
    996: {996: Decimal("9.-10")},
    997: {997: Decimal("9.-10")},
    998: {998: Decimal("9.-10")},
    999: {999: Decimal("9.-10")},
    1000: {1000: Decimal("9.-10")},
}

def EV_lookup(p:int, q:int) -> Decimal:
    if (p - q) % 6 != 0:
        return Decimal("0")
    if q < p:
        p, q = q, p
    row = EV_SPARSE.get(p)
    if row is None: return Decimal("0")
    return row.get(q, Decimal("0"))